import { parse } from 'path';
import React, { Component } from 'react';
import "./ClassId.css";

class ClassId extends Component {
    constructor(props) {
        super(props);
        this.handleClick = this.handleClick.bind(this);
        this.state = {
            class_id: '',
        }
    }
    handleClick(event) {
        const classId = parseInt(document.querySelector("#classid").value);
        console.log(classId);
    }

    render() {
        return (
            <div className="classId">
                <div class="input-group mb-3">
                    <div class="input-group-text">
                        <input class="form-check-input" type="checkbox" value="" aria-label="Checkbox for following text input"></input>
                    </div>
                        <input type="text" class="form-control" id="classid" aria-label="Text input with checkbox"></input>
                </div>
            </div>
        )
    }
}

export default ClassId;
